SELECT ?org ?orgLabel WHERE {
  ?org wdt:P31 / wdt:P279 * wd:Q2401749 ; wdt:P17 wd:Q31 .
  OPTIONAL {
    ?org rdfs:label ?orgLabel .
    FILTER ( LANG( ?orgLabel ) = 'en' )
  }
}

