PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?cairoPopulation ?largestCity ?largestCityPopulation WHERE {
  wd:Q668 wdt:P1082 ?cairoPopulation .
  {
    SELECT ?city ?population WHERE {
      ?city wdt:P31 wd:Q515 ; wdt:P17 wd:Q10 ; wdt:P1082 ?population .
    }
    ORDER BY DESC ( ?population )
    LIMIT 1
  }
  BIND( ?city AS ?largestCity ) BIND( ?population AS ?largestCityPopulation )
}

