  FILTER ( LANG( ?governmentTypeLabel ) = 'en' ) FILTER ( CONTAINS( ?governmentTypeLabel , 'Communism' ) || CONTAINS( ?governmentTypeLabel , 'Communist' ) ) OPTIONAL {
    ?country rdfs:label ?countryLabel FILTER ( LANG( ?countryLabel ) = 'en' )
  }
}

